import unittest
import ORsudoku
  
class TestPuzzle(unittest.TestCase):
	# Puzzle: Texas-Sized 10-4
	# Author: jeremydover
	# Constraints tested: set10Line, setGivenArray, digitSet
	
	def test_puzzle(self):
		p = ORsudoku.sudoku(3,digitSet={0,1,2,3,4,5,6,7,8})
		p.setGivenArray([111,120,132,144,361,370,382,394,721,730,742,754,851,860,872,884])
		p.set10Line([49,59,69,79,89,99,98,97,96])
		p.set10Line([22,23,24,25,26,27,28])
		p.set10Line([34,33,43,52,41,51,61,62,63])
		p.set10Line([91,92])
		p.set10Line([44,54,64,55,56,66])
			
		self.assertEqual(p.countSolutions(test=True),'4:','Failed Texas-Sized 10-4')
		
if __name__ == '__main__':
    unittest.main()